    def load_compeleted_orders(self):
        sql = "SELECT * FROM orders WHERE status = %s retaurant_id = %s" # sql command 
        val = ('compeleted', self.restraunt_id) 
        mycursor.execute(sql, val)
        orders = mycursor.fetchall()

        for order in orders:
                rowPosition = self.tableWidget_2.rowCount()
                self.tableWidget_2.insertRow(rowPosition)
                # add rows to table 
                self.tableWidget_2.setItem(rowPosition, 0, QtWidgets.QTableWidgetItem(str(order[0])))
                self.tableWidget_2.setItem(rowPosition, 1, QtWidgets.QTableWidgetItem(str(order[3])))
                self.tableWidget_2.setItem(rowPosition, 2, QtWidgets.QTableWidgetItem(str(order[5])))


    def load_waiting_orders(self):
        sql = "SELECT * FROM orders WHERE status = %s and retaurant_id = %s"
        val = ('waiting',self.restraunt_id) 
        mycursor.execute(sql, val)
        orders = mycursor.fetchall()

        for order in orders:
                rowPosition = self.tableWidget_3.rowCount()
                self.tableWidget_3.insertRow(rowPosition)
                # add rows to table 
                self.tableWidget_3.setItem(rowPosition, 0, QtWidgets.QTableWidgetItem(str(order[0])))
                self.tableWidget_3.setItem(rowPosition, 1, QtWidgets.QTableWidgetItem(str(order[3])))
                self.tableWidget_3.setItem(rowPosition, 2, QtWidgets.QTableWidgetItem(str(order[5])))


    def load_menu(self):
        mycursor.execute(f"SELECT * FROM foodofrestuarant WHERE restuarant_id = {self.restraunt_id}")
        foods = mycursor.fetchall()

        for food in foods:
                rowPosition = self.tableWidget.rowCount()
                self.tableWidget.insertRow(rowPosition)
                # add rows to table 
                self.tableWidget.setItem(rowPosition, 0, QtWidgets.QTableWidgetItem(str(food[1])))
                self.tableWidget.setItem(rowPosition, 1, QtWidgets.QTableWidgetItem(str(food[3])))
                self.tableWidget.setItem(rowPosition, 2, QtWidgets.QTableWidgetItem(str(food[7])))
                self.tableWidget.setItem(rowPosition, 3, QtWidgets.QTableWidgetItem(str(food[6])))
                self.tableWidget.setItem(rowPosition, 4, QtWidgets.QTableWidgetItem(str(food[4])))


    def add_food(self):
        """ adding food to database"""
        sql_foodofrest = "INSERT INTO foodofrestuarant (restuarant_id, food_kind, food_name, food_inventory, food_material, food_fixedprice, food_customerprice) VALUES (%s,%s,%s,%s,%s,%s,%s)"
        val = (self.restraunt_id, self.foodkind_combobox.currentText(), self.foodname_input.text(), int(self.inventory_input.value()), self.material_input.text(), self.fixedprice_input.text(), self.costumerprice_input.text())
        mycursor.execute(sql_foodofrest,val)
        mydb.commit()

        self.foodname_input.setText('')
        self.material_input.setText('')
        self.fixedprice_input.setText('')
        self.costumerprice_input.setText('')
        self.inventory_input.setValue(0)


